[
         "sid": "38565",
         "Technique ID": "T1197",
         "Technique name": "BITS Jobs",
         "Quotes": ""Adversaries may abuse Background Intelligent Transfer Service (BITS) jobs to persistently execute code and perform various background tasks. This technique can be used to maintain persistence, upgrade malware, stage additional malware, or exfiltrate data."",
         "Explanation": ""The rule identifies an attempt to download a malicious binary using the BITS protocol, which is commonly abused by malware to achieve persistence and execute follow-on activities."
     ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique Name": "Exploit Public-Facing Application",
     "Quotes": "Adversaries may attempt to exploit a weakness in an Internet-facing host or system to initially access a network.",
     "Explanation": "This rule detects an attempt to download a malicious binary file using the BITS protocol, which is a common method used by malware to download and execute additional payloads."
   }
 ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique Name": "Initial Access Broker",
     "Quotes": null,
     "Explanation": "The rule triggers when an attempt to download a malicious payload is detected. Initial access brokers often use social engineering techniques to trick victims into downloading malware. In this case, the malware is disguised as a legitimate file, and the victim is tricked into downloading it by clicking on a link in an email or visiting a malicious website."
   }
 ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "Download Remote File",
     "Quotes": "\"Adversaries may attempt to download files from remote locations to prepare for follow-on actions,.",
     "Explanation": "This event is generated when malware is detected attempting to download a file. It specifically looks for a pattern indicating a Win.Trojan.Sweeper variant that uses the Microsoft BITS (Background Intelligent Transfer Service) User-Agent and downloads a file with a .bin extension."
   },
   {
     "sid": "38565",
     "Technique ID": "T1059",
     "Technique name": "Command and Scripting Interpreter",
     "Quotes": "\"Adversaries may abuse command and script interpreters to execute commands, scripts, or binaries.",
     "Explanation": "The downloaded file may contain malicious commands or scripts that can be executed by the malware."
   }
 ][
         "sid": "38565",
         "Technique ID": "T1197",
         "Technique name": "Initial Access Vector",
         "Quotes": "Adversaries may use any access vector to initially gain access to a system. This is typically accomplished through phishing emails, malicious websites, drive-by downloads, etc.",
         "Explanation": "This rule looks for a malware variant that is being downloaded through a HEAD request to a server. The malware's User-Agent is set to \"Microsoft BITS\" and the request includes the header \"Accept-Encoding: identity\". The URI of the request contains a string of 32 hexadecimal characters followed by \".bin\""
     ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "Remote System Discovery",
     "Quotes": "Adversaries may attempt to identify, enumerate, and characterize network hosts for reconnaissance or targeting purposes.",
     "Explanation": "This event is generated when a client attempts to download a file named \"*.bin\" from a remote web server using the HTTP \"HEAD\" method. This behavior  is consistent with techniques used by malware to establish initial connections with a command and control server in order to download additional malicious components."
   }
 ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "Exploitation for Client Execution",
     "Quotes": "Adversaries may exploit software vulnerabilities in client applications to execute code. The rule identifies an initial download attempt associated with a malware variant specifically targeting Windows systems, suggesting an attempt to exploit a client-side vulnerability to execute malicious code.",
     "Explanation": "This rule looks for attempts to download a malicious binary file from a remote server."
   }
 ][
   {
     "sid": "38565",
     "Technique ID": "T1564",
     "Technique name": "Hide Artifacts",
     "Quotes": "Adversaries may attempt to hide artifacts associated with their behaviors to evade detection.",
     "Explanation": "The rule looks for a dropper attempting to download the next stage payload from a remote server using HTTP, and the dropper tries to hide by disguising itself as Microsoft BITS."
   },
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "File Download",
     "Quotes": "Adversaries may download files from remote locations to a compromised system.",
     "Explanation": "The rule looks for a dropper attempting to download the next stage payload from a remote server using HTTP."
   }
 ][
         "sid": "38565",
         "Technique ID": "T1197",
         "Technique name": "Initial Access Broker: Malware Dropper",
         "Quotes": ""Initial Access Brokers are a \"middleman\" for cyber criminals and provide many services for those seeking access to networks. Droppers are used for the post-exploitation stage of an attack and are used to download and execute additional malware.",
         "Explanation": "This rule looks for activity associated with the download of a Win.Trojan.Sweeper variant, which is a type of malware used by initial access brokers."
     ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "File Download",
     "Quotes": "\"Adversaries may download files to the victim system to enable execution of malicious code\"",
     "Explanation": "This rule detects download attempts of malicious executable files by a Trojan variant."
   },
   {
     "sid": "38565",
     "Technique ID": "T1531",
     "Technique name": "Dropper",
     "Quotes": "\"Adversaries may use malware to download additional malicious content onto a target system\"",
     "Explanation": "The rule identifies the initial download stage of a dropper malware, which is a type of malware that downloads and installs other malicious software onto a system."
   }
 ][
   {
     "sid": "38565",
     "Technique ID": "T1197",
     "Technique name": "File Download",
     "Quotes": "\"Techniques involving the downloading of files from a remote system\"",
     "Explanation": "This rule detects attempts by the malware Win.Trojan.Sweeper to download an executable file (.bin) from a remote server."
   },
   {
     "sid": "38565",
     "Technique ID": "T1496",
     "Technique name": "Resource Hijacking",
     "Quotes": "\"Adversaries may leverage the resources of co-opted systems to complete resource-intensive tasks, which may impact system and/or hosted service availability\"",
     "Explanation": "The malware may use the downloaded file to hijack system resources for malicious purposes."
   }
 ]

